import './ColorCard.css'


const ColorCard = (props) => {


    return (
        <div className="user_card" style={{backgroundColor: props.card.color}}>
            <h4>{props.card.username}</h4>
            <button>Delete Post</button>
        </div>
    );
};

export default ColorCard;
